import React, {Component} from 'react';
const logo = require('./burger-queen-logo.jpg');

class ComponentHome extends Component{
    render(){
        return (
            <React.Fragment>
           <img src={logo} />
           <h1>Burger Queen</h1>

            </React.Fragment>
        );
    }
}    

export default ComponentHome;
